class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        if not s:
        	return None
        else:
        	l = []
        	buf = {}
	        for ch in s:
	        	if ch in l:
	        		buf[len(l)] = l
	        		l = [x for x in l if x not in l[0:l.index(ch) + 1]]
	        		l.append(ch)
	        	else:
	        		l.append(ch)
	        buf[len(l)] = l
	        return ''.join(l) if not buf else ''.join(buf[max(buf, key=int)])

